let optionsContainer = {
    zIndex: 5,
    display: 'flex',
    width: '25%',
    height: 30,
    margin: "10px 0 0 auto",
    flexWrap: 'wrap',
    userSelect: "none",
}

let optionsMenuContainer = {
    display: 'flex',
    width: 304,
    marginLeft: 'auto'
}

export {
    optionsContainer,
    optionsMenuContainer
}
